import React from "react";
import "./SideDrawer.css";

const sideDrawer = props => {
  let drawerClasses = ["side-drawer"];

  if (props.show) {
    drawerClasses = "side-drawer open";
  }
  return (
  <nav className = {drawerClasses}>
    <ul>
      <li><a href = "#" onclick = "return false;" onmousedown = "autoScrollTo('div1');"> Visitor Centers</a></li>
      <li><a href = "#" onclick = "return false;" onmousedown = "autoScrollTo('div2');"> Articles</a></li>
      <li><a href = "#" onclick = "return false;" onmousedown = "autoScrollTo('div3');"> News Releases</a></li>
      <li><a href = "#" onclick = "return false;" onmousedown = "autoScrollTo('div4');"> Educational Info</a></li>
      <li><a href = "#" onclick = "return false;" onmousedown = "autoScrollTo('div5');"> Events</a></li>
      <li><a href = "#" onclick = "return false;" onmousedown = "autoScrollTo('div6');"> Alerts</a></li>
    </ul>
  </nav>
);
};

export default sideDrawer;
